protected boolean processOperatingSystemCommand(ArrayList<Object> options) {
    int command = optionInt0(options, 0);
    String label = (String) options.get(1);
    // for command > 2 label could be composed (i.e. contain ';'), but we'll leave
    // it to processUnknownOperatingSystemCommand implementations to handle that
    try {
        switch (command) {
            case 0:
                processChangeIconNameAndWindowTitle(label);
                return true;
            case 1:
                processChangeIconName(label);
                return true;
            case 2:
                processChangeWindowTitle(label);
                return true;

            default:
                // not exactly unknown, but not supported through dedicated process methods:
                processUnknownOperatingSystemCommand(command, label);
                return true;
        }
    } catch (IllegalArgumentException ignore) {
    }
    return false;
}

protected boolean processEscapeCommand(ArrayList<Object> options, int command) throws IOException {
    try {
        switch (command) {
            case 'A':
                processCursorUp(optionInt1(options, 0, 1));
                return true;
            case 'B':
                processCursorDown(optionInt1(options, 0, 1));
                return true;
            case 'C':
                processCursorRight(optionInt1(options, 0, 1));
                return true;
            case 'D':
                processCursorLeft(optionInt1(options, 0, 1));
                return true;
            case 'E':
                processCursorDownLine(optionInt1(options, 0, 1));
                return true;
            case 'F':
                processCursorUpLine(optionInt1(options, 0, 1));
                return true;
            case 'G':
                processCursorToColumn(optionInt0(options, 0));
                return true;
            case 'H':
            case 'f':
                processCursorTo(optionInt1(options, 0, 1), optionInt1(options, 1, 1));
                return true;
            case 'J':
                processEraseScreen(optionInt1(options, 0, 0));
                return true;
            case 'K':
                processEraseLine(optionInt1(options, 0, 0));
                return true;
            case 'L':
                processInsertLine(optionInt1(options, 0, 1));
                return true;
            case 'M':
                processDeleteLine(optionInt1(options, 0, 1));
                return true;
            case 'S':
                processScrollUp(optionInt1(options, 0, 1));
                return true;
            case 'T':
                processScrollDown(optionInt1(options, 0, 1));
                return true;
            case 'm':
                // Validate all options are ints...
                for (Object next : options) {
                    if (next != null && next.getClass() != Integer.class) {
                        throw new IllegalArgumentException();
                    }
                }

                int count = 0;
                Iterator<Object> optionsIterator = options.iterator();
                while (optionsIterator.hasNext()) {
                    Object next = optionsIterator.next();
                    if (next != null) {
                        count++;
                        int value = (Integer) next;
                        if (30 <= value && value <= 37) {
                            processSetForegroundColor0(value - 30);
                        } else if (40 <= value && value <= 47) {
                            processSetBackgroundColor0(value - 40);
                        } else if (90 <= value && value <= 97) {
                            processSetForegroundColor1(value - 90, true);
                        } else if (100 <= value && value <= 107) {
                            processSetBackgroundColor1(value - 100, true);
                        } else if (value == 38 || value == 48) {
                            if (!optionsIterator.hasNext()) {
                                continue;
                            }
                            // extended color like `esc[38;5;<index>m` or `esc[38;2;<r>;<g>;<b>m`
                            int arg2or5 = getNextOptionInt(optionsIterator);
                            if (arg2or5 == 2) {
                                // 24 bit color style like `esc[38;2;<r>;<g>;<b>m`
                                int r = getNextOptionInt(optionsIterator);
                                int g = getNextOptionInt(optionsIterator);
                                int b = getNextOptionInt(optionsIterator);
                                if (r >= 0 && r <= 255 && g >= 0 && g <= 255 && b >= 0 && b <= 255) {
                                    if (value == 38) processSetForegroundColorExt1(r, g, b);
                                    else processSetBackgroundColorExt1(r, g, b);
                                } else {
                                    throw new IllegalArgumentException();
                                }
                            } else if (arg2or5 == 5) {
                                // 256 color style like `esc[38;5;<index>m`
                                int paletteIndex = getNextOptionInt(optionsIterator);
                                if (paletteIndex >= 0 && paletteIndex <= 255) {
                                    if (value == 38) processSetForegroundColorExt0(paletteIndex);
                                    else processSetBackgroundColorExt0(paletteIndex);
                                } else {
                                    throw new IllegalArgumentException();
                                }
                            } else {
                                throw new IllegalArgumentException();
                            }
                        } else {
                            switch (value) {
                                case 39:
                                    processDefaultTextColor();
                                    break;
                                case 49:
                                    processDefaultBackgroundColor();
                                    break;
                                case 0:
                                    processAttributeReset();
                                    break;
                                default:
                                    processSetAttribute(value);
                            }
                        }
                    }
                }
                if (count == 0) {
                    processAttributeReset();
                }
                return true;
            case 's':
                processSaveCursorPosition();
                return true;
            case 'u':
                processRestoreCursorPosition();
                return true;

            default:
                if ('a' <= command && command <= 'z') {
                    processUnknownExtension(options, command);
                    return true;
                }
                if ('A' <= command && command <= 'Z') {
                    processUnknownExtension(options, command);
                    return true;
                }
                return false;
        }
    } catch (IllegalArgumentException ignore) {
    }
    return false;
}

protected int getNextOptionInt(Iterator<Object> optionsIterator) throws IOException {
    for (; ; ) {
        if (!optionsIterator.hasNext()) throw new IllegalArgumentException();
        Object arg = optionsIterator.next();
        if (arg != null) return (Integer) arg;
    }
}

public AnsiProcessor(OutputStream os) {
