private int optionInt1(ArrayList<Object> options, int index, int defaultValue) {
    if (options.size() > index) {
        Object value = options.get(index);
        if (value == null) {
            return defaultValue;
        }
        return (Integer) value;
    }
    return defaultValue;
}

private int optionInt0(ArrayList<Object> options, int index) {
    if (options.size() <= index) throw new IllegalArgumentException();
    Object value = options.get(index);
    if (value == null) throw new IllegalArgumentException();
    if (!value.getClass().equals(Integer.class)) throw new IllegalArgumentException();
    return (Integer) value;
}
